Read the method definition below:

public class Container
{
    int type;
    int beans;

    public Container()
    {
        System.out.print("a");
        this.type = 0;
        this.beans = 0;
    }

    public Container(int type, int beans)
    {
        System.out.print("b");
        this.type = type;
        this.beans = beans;
    }

    public String toString()
    {
        return this.type + "-" + this.beans;
    }
}

